#include "ARMCM0.h"
#include "gpio.h"
#include "pad_mux_ctrl.h"
#include "delay.h"
#include "led_key.h"
#include "uart.h"
#include "queue.h"
#include "debug.h"
#include "i2c_master.h"
#include "oled_9632.h"

const uint8_t flash_1[100*1000];
const uint8_t flash_2[100*1000];
//const uint8_t flash_3[100*1000];
//const uint8_t flash_4[100*1000];

uint8_t RAM_1[100][1000]={0xaa};
int main()
{	
	uint8_t vol=0,*p_vol;
	uint32_t i=0;
	__disable_irq();
	//GPO
	pad_mux_write(LED1, 0);
	pad_mux_write(LED2, 0);
	pad_mux_write(LED3, 0);
	pad_mux_write(LED4, 0);
	gpo_config(LED1,1);
	gpo_config(LED2,1);
	gpo_config(LED3,1);
  gpo_config(LED4,1);
	
	//GPI
	pad_mux_write(KEY1, 0);
	pad_mux_write(KEY2, 0);
	pad_mux_write(KEY3, 0);
	pad_mux_write(KEY4, 0);
	gpi_config(KEY1, PULL_UP);
	gpi_config(KEY2, PULL_UP);
	gpi_config(KEY3, PULL_UP);
	gpi_config(KEY4, PULL_UP);

  //uart 0
	pad_mux_write(20, 7);
	pad_mux_write(21, 7);
	dbg_init();
	dbg_printf("SYD8821 CACHE 248KB DEMO\r\n");

	// IIC
	pad_mux_write(12, 6); //i2c 0 scl
	pad_mux_write(13, 6); //i2c 0 sda

	/* Masters Init M0*/
	//set i2c clk rate param 0, (48/8)*50K=300k 
	i2c_master_set_speed(0, 0);
	i2c_master_enable(0, true);
	i2c_master_enable_int(0, true);
	i2c_master_set_address_mode(0, I2C_MASTER_1BYTE_ADDRESS);
	NVIC_EnableIRQ(I2CM0_IRQn);
	
	oled_init();
	
//	oled_printf(0,0,"SYD Inc."); 
//	oled_printf(0,2,"SYD8821 EVB"); 
//	oled_printf(0,4,"496KB Cache demo"); 
//	oled_printf(0,6,"2018-3-27"); 

	oled_printf(0,0,"SYD TEK."); 
	oled_printf(0,2,"SYD8821 Board"); 
	oled_printf(0,4,"Cache 496KB sam"); 
	oled_printf(0,6,"maid:piaoran"); 
	
	dbg_hexdump("flash_1:\r\n",(uint8_t *)flash_1,32);
	dbg_hexdump("flash_2:\r\n",(uint8_t *)flash_2,32);
//	dbg_hexdump("flash_3:\r\n",(uint8_t *)flash_3,32);
//	dbg_hexdump("flash_4:\r\n",(uint8_t *)flash_4,32);
	
	delay_ms(3000);
	__enable_irq();
	while(1)
	{
		gpo_toggle(LED4);
		
		dbg_printf("vol:%x\r\n",vol);
		p_vol=(uint8_t *)RAM_1;
		for(i=0;i<sizeof(RAM_1);i++){
		 *p_vol=vol;
			p_vol ++;
		}
		for(i=0;i<sizeof(RAM_1)/1000;i++){
			dbg_hexdump("RAM_1:\r\n",(uint8_t *)RAM_1+i*1000,16);
		}
		
		vol++;

		delay_ms(1000);
	}		
}
